import React from "react";
import Grid from "@material-ui/core/Grid";


export default class FooterItems extends React.Component {
     constructor() {
        super();
        this.state = {
            about: 'https://about.instagram.com/about-us',

        };
    }

    render () {
         return (
            <React.Fragment>
                <Grid item xs={1}>
                    <Home/>
                </Grid>
                <Grid item xs={1}>
                    <Search/>
                </Grid>
                <Grid item xs={1}>
                    <Upload/>
                </Grid>
                <Grid item xs={1}>
                    <Notification/>
                </Grid>
                <Grid item xs={1}>
                    <Profile/>
                </Grid>
            </React.Fragment>
         )
    }
}
